        <TimeButton mins={'45'} onClick={this.changedMins(45)} isActive={this.state.active === '45'}></TimeButton>
        <TimeButton mins={'60'} onClick={this.changedMins(60)} isActive={this.state.active === '60'}></TimeButton>
        </div>
        </div>
      </div>
    )
  }
}
